import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, View, Text, Pressable } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { Border, Color, FontFamily, FontSize } from "../GlobalStyles";

const AndroidSmall16 = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.androidSmall16}>
      <Image
        style={[styles.androidSmall16Child, styles.androidPosition]}
        contentFit="cover"
        source={require("../assets/ellipse-21.png")}
      />
      <Image
        style={[styles.androidSmall16Item, styles.androidPosition]}
        contentFit="cover"
        source={require("../assets/vector-6.png")}
      />
      <Image
        style={styles.androidSmall16Inner}
        contentFit="cover"
        source={require("../assets/ellipse-16.png")}
      />
      <Image
        style={styles.undrawMaleAvatarG98d1Icon}
        contentFit="cover"
        source={require("../assets/undraw-male-avatar-g98d-1.png")}
      />
      <View style={[styles.rectangleView, styles.rectangleChildLayout]} />
      <View
        style={[styles.androidSmall16Child1, styles.rectangleChildLayout]}
      />
      <View
        style={[styles.androidSmall16Child1, styles.rectangleChildLayout]}
      />
      <View
        style={[styles.androidSmall16Child3, styles.rectangleChildLayout]}
      />
      <View
        style={[styles.androidSmall16Child3, styles.rectangleChildLayout]}
      />
      <Text style={[styles.productName, styles.productFlexBox]}>
        {" "}
        product name
      </Text>
      <Text
        style={[styles.productDescription, styles.productFlexBox]}
      >{`product description `}</Text>
      <Text
        style={[styles.productQuantity, styles.productFlexBox]}
      >{` product quantity `}</Text>
      <View
        style={[styles.androidSmall16Child5, styles.rectangleChildLayout]}
      />
      <View
        style={[styles.androidSmall16Child5, styles.rectangleChildLayout]}
      />
      <Text
        style={[styles.productPrice, styles.productFlexBox]}
      >{`product price `}</Text>
      <Text style={[styles.productImage, styles.productFlexBox]}>
        product image
      </Text>
      <Pressable
        style={[styles.rectanglePressable, styles.rectangleChildLayout]}
        onPress={() => navigation.navigate("AndroidSmall4")}
      />
      <Text style={[styles.back, styles.productFlexBox]}>Back</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  androidPosition: {
    left: 0,
    position: "absolute",
  },
  rectangleChildLayout: {
    height: 57,
    width: 330,
    borderRadius: Border.br_8xs,
    left: 15,
    position: "absolute",
  },
  productFlexBox: {
    textAlign: "left",
    position: "absolute",
  },
